import "./Navbar.scss";
import logo from "../../helpers/logo.png";

const Navbar = () => {
    return (
        <div className="navbar">
            <div className="logo">
                <img src={logo} alt=""  />
            </div>
        </div>
    )
}

export default Navbar;
